#
# TABLE STRUCTURE FOR: awards
#

DROP TABLE IF EXISTS `awards`;

CREATE TABLE `awards` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `winner` int(9) DEFAULT NULL,
  `given` date NOT NULL,
  `eventID` int(9) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `eventID` (`eventID`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: chicken
#

DROP TABLE IF EXISTS `chicken`;

CREATE TABLE `chicken` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `personID` int(11) NOT NULL,
  `dob` date DEFAULT NULL,
  `tier` int(1) NOT NULL,
  `name` varchar(255) NOT NULL,
  `attack` int(2) NOT NULL,
  `defense` int(2) NOT NULL,
  `health` int(2) NOT NULL DEFAULT 1,
  `rank` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `rank` (`rank`),
  UNIQUE KEY `id_2` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: event
#

DROP TABLE IF EXISTS `event`;

CREATE TABLE `event` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `city` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  `startDate` datetime NOT NULL,
  `endDate` datetime NOT NULL,
  `poster` int(1) NOT NULL,
  `slogan` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: fight
#

DROP TABLE IF EXISTS `fight`;

CREATE TABLE `fight` (
  `id` int(9) NOT NULL,
  `eventID` int(9) NOT NULL,
  `chick1` int(9) NOT NULL,
  `chick2` int(9) NOT NULL,
  `endDate` timestamp NOT NULL DEFAULT current_timestamp(),
  `startDate` timestamp NOT NULL DEFAULT current_timestamp(),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `id_2` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: person
#

DROP TABLE IF EXISTS `person`;

CREATE TABLE `person` (
  `id` int(11) NOT NULL,
  `fname` varchar(100) NOT NULL,
  `lname` varchar(255) NOT NULL,
  `dob` date NOT NULL,
  `phone` int(7) NOT NULL,
  `email` varchar(50) NOT NULL,
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



